class RoundedRect:
    def DrawRoundedRect(self, surface, rect, color, corner_radius):
        ''' Draw a rectangle with rounded corners.
        Would prefer this:
            pygame.draw.rect(surface, color, rect, border_radius=corner_radius)
        but this option is not yet supported in my version of pygame so do it ourselves.

        We use anti-aliased circles to make the corners smoother '''

        if rect.width < 2 * corner_radius or rect.height < 2 * corner_radius:
            raise ValueError(f'Both height (rect.height) and width (rect.width) must be > 2 * corner radius ({corner_radius})')

        # need to use anti aliasing circle drawing routines to smooth the corners
        pygame.gfxdraw.aacircle(surface, rect.left + corner_radius, rect.top + corner_radius, corner_radius, color)
        pygame.gfxdraw.aacircle(surface, rect.right - corner_radius - 1, rect.top + corner_radius, corner_radius, color)
        pygame.gfxdraw.aacircle(surface, rect.left + corner_radius, rect.bottom - corner_radius - 1, corner_radius, color)
        pygame.gfxdraw.aacircle(surface, rect.right - corner_radius - 1, rect.bottom - corner_radius - 1, corner_radius, color)

        pygame.gfxdraw.filled_circle(surface, rect.left + corner_radius, rect.top + corner_radius, corner_radius, color)
        pygame.gfxdraw.filled_circle(surface, rect.right - corner_radius - 1, rect.top + corner_radius, corner_radius, color)
        pygame.gfxdraw.filled_circle(surface, rect.left + corner_radius, rect.bottom - corner_radius - 1, corner_radius, color)
        pygame.gfxdraw.filled_circle(surface, rect.right - corner_radius - 1, rect.bottom - corner_radius - 1, corner_radius, color)

        rect_tmp = pygame.Rect(rect)

        rect_tmp.width -= 2 * corner_radius
        rect_tmp.center = rect.center
        pygame.draw.rect(surface, color, rect_tmp)

        rect_tmp.width = rect.width
        rect_tmp.height -= 2 * corner_radius
        rect_tmp.center = rect.center
        pygame.draw.rect(surface, color, rect_tmp)

    def DrawBorderedRoundedRect(self, surface, rect, color, border_color, corner_radius, border_thickness):
        if corner_radius < 0:
            raise ValueError(f'border radius ({corner_radius}) must be >= 0')

        rect_tmp = pygame.Rect(rect)
        center = rect_tmp.center

        if border_thickness:
            if corner_radius <= 0:
                pygame.draw.rect(surface, border_color, rect_tmp)
            else:
                self.DrawRoundedRect(surface, rect_tmp, border_color, corner_radius)

            rect_tmp.inflate_ip(-2 * border_thickness, -2 * border_thickness)
            inner_radius = corner_radius - border_thickness + 1
        else:
            inner_radius = corner_radius

        if inner_radius <= 0:
            pygame.draw.rect(surface, color, rect_tmp)
        else:
            self.DrawRoundedRect(surface, rect_tmp, color, inner_radius)


class GameButton:
    def __init__(self, buttonIndex, buttonPos, buttoDim, buttonPassiveColor, buttonActiveColor, icon, buttonCornerRadius=15, iconRatio=0.50, text=None, font=None, fontColor=None, textRectColor=None):
        # ----- Button's Index
        self.buttonIndex = buttonIndex

        # ----- Button's Rect
        self.buttonRect = pygame.Rect(buttonPos[0], buttonPos[1], buttoDim[0], buttoDim[1])

        # ----- Button's Color
        self.buttonPassiveColor = buttonPassiveColor
        self.buttonActiveColor = buttonActiveColor
        self.buttonColor = buttonPassiveColor

        # ----- Text
        self.text = text
        if self.text is not None:
            # --- Text Surfaces
            ''' Prepare text surface for single or multiple texts 
                        (single like 'Menu' and multiple like 'Menu\nBack to Main Menu'). '''

            # Split text into list with respect to existence of '\n'
            textPartsList = text.split('\n')

            # Prepare text surfaces for each part of text ('Hello\nWorld' >> 'Hell' = part #1, 'World' = part #2)
            self.textSurs = []
            self.textSursRects = []
            for i in range(len(textPartsList)):
                self.textSurs.append(font.render(textPartsList[i], True, fontColor))
                self.textSursRects.append(pygame.Rect(0, 0, self.textSurs[i].get_width(), self.textSurs[i].get_height()))

            # Calculate sum of all text surfaces heights, it helps us to determine text rect height
            textSursHeightList = []
            for sur in self.textSurs:
                textSursHeightList.append(sur.get_height())

            # --- Text's Rect
            # --- Options
            self.diffBetweenSurs = 5
            self.widthReplacement = 5
            self.heightReplacement = 10

            # --- Rect
            self.textRect = pygame.Rect(0, 0, 0, 0)

            # --- Rect Height
            # For single surface
            if len(self.textSurs) == 1:
                self.textRect.height = sum(textSursHeightList) + self.heightReplacement
            # For multiple surfaces
            else:
                self.textRect.height = sum(textSursHeightList) + self.heightReplacement + (len(self.textSurs) - 1) * self.diffBetweenSurs
                # Why 'LEN(TEXT-SURS) - 1' not 'LEN(TEXT-SURS)' ?! Because of existence of N-1 difference-space between N objects.

            # --- Rect Color
            self.textRectColor = textRectColor

        # ----- Icon
        self.icon = icon
        self.iconRatio = iconRatio  # The ratio of x-position of icon, if ratio = 0.5, then icon center-x = button center-x, and so on
        self.iconRect = pygame.Rect(0, 0, icon.get_width(), icon.get_height())

        # ----- Button Options
        self.buttonCornerRadius = buttonCornerRadius
        self.isActive = False

    def updateAndDraw(self, Win, mouseClick, keyCursor, keyCursorClick, mousePos):
        # --- Draw button ---
        RoundedRect().DrawRoundedRect(Win, self.buttonRect, self.buttonColor, self.buttonCornerRadius)

        # --- Draw icon ---
        if self.iconRatio == 0.5:
            self.iconRect.centerx = self.buttonRect.centerx
            Win.blit(self.icon, (self.iconRect.x, self.buttonRect.centery - self.icon.get_height() // 2))
        else:
            icon_x = self.buttonRect.x + int(self.buttonRect.width * self.iconRatio) - (self.icon.get_width() // 2)
            Win.blit(self.icon, (icon_x, self.buttonRect.centery - self.icon.get_height() // 2))

        # --- Collision & Functionality ---
        if self.buttonRect.collidepoint(mousePos) or keyCursor == self.buttonIndex:
            if mouseClick and keyCursor != self.buttonIndex:
                # Button' functionality = True
                self.isActive = True

                # Reset keyCursor & keyCursorClick variables
                keyCursor = None
                keyCursorClick = None
            elif keyCursorClick and keyCursor == self.buttonIndex:
                # Button' functionality = True
                self.isActive = True

                # Reset keyCursor & keyCursorClick variables
                keyCursor = None
                keyCursorClick = None
            else:
                # Button' functionality = False
                self.isActive = False

                # Button active color
                self.buttonColor = self.buttonActiveColor

                # Button's text
                if self.text is not None:
                    # Text rect
                    self.textRect.width = self.buttonRect.width
                    self.textRect.x = self.buttonRect.x
                    self.textRect.bottom = self.buttonRect.bottom

                    # Draw text rounded rect
                    RoundedRect().DrawRoundedRect(Win,  self.textRect, self.textRectColor, self.buttonCornerRadius - 5)

                    # Text
                    if len(self.textSurs) == 1:
                        self.textSursRects[0].center = self.textRect.center
                        Win.blit(self.textSurs[0], (self.textSursRects[0].x, self.textSursRects[0].y))
                    else:
                        for i in range(len(self.textSurs)):
                            if i == 0:
                                self.textSursRects[i].centerx = self.textRect.centerx
                                self.textSursRects[i].top = self.textRect.top + self.heightReplacement//2
                                Win.blit(self.textSurs[i], (self.textSursRects[i].x, self.textSursRects[i].y))
                            else:
                                x = self.textSursRects[i].x = self.buttonRect.centerx - self.textSursRects[i].width // 2 + 2.5
                                y = self.textSursRects[i].y = self.textSursRects[i - 1].bottom + self.diffBetweenSurs
                                Win.blit(self.textSurs[i], (x, y))
        else:
            # Button' functionality = False
            self.isActive = False

            # Button passive color
            self.buttonColor = self.buttonPassiveColor

        return keyCursor, keyCursorClick


def PrepareSpriteSheets(path, num_of_frames, scale=None):
    no_longer_list = list()
    frames_list = list()

    for i in range(num_of_frames):
        no_longer_list.append(pygame.image.load(path.replace('**', str(i))))

        # Optional: Scale frames
        if scale is not None:
            frames_list.append(pygame.transform.scale(no_longer_list[i], (int(scale[0]), int(scale[1]))))

    # If frames wasn't scaled ==> frames_list = no_longer_list
    if scale is None:
        return no_longer_list

    no_longer_list.clear()
    return frames_list


class GIF:
    def __init__(self, framesList):
        self.frames = framesList
        self.counter = 0
        self.splitFactor = 3

    def get_height(self):
        return self.frames[0].get_height()

    def get_width(self):
        return self.frames[0].get_width()

    def draw(self, Win, pos, split_factor=None):
        self.splitFactor = split_factor

        if self.counter < len(self.frames) * self.splitFactor - 1:
            self.counter += 1
        else:
            self.counter = 0

        Win.blit(self.frames[self.counter // self.splitFactor], pos)
